import './List.sass';
import Search from '../search/Search';
import edit from '../../../icons/edit.svg';
import deleteIcon from '../../../icons/delete.svg';
import { Context } from '../../..';
import { useContext, useEffect, useState } from 'react';
import { ListItem } from '../../../models/ListItem';


const List = () => {

	const [items, setItems] = useState<Array<ListItem>>([]);
	const {store} = useContext(Context);

    useEffect(() => {
		async function fetchData() {
			const res = await store.generate_list();
			setItems(res);
		}
		fetchData();
	// eslint-disable-next-line react-hooks/exhaustive-deps
	}, []);

    return(
        <div className='list'>
            <table>
                <thead>
                    <Search/>
                </thead>
                <tbody>
                  {items.map((element) => (
                    <tr key={Number(element._id)}>
                      	<td>
							<div className="list__edit"><img src={edit} alt="Edit icon" /></div>
						</td>
                      	<td>{element.description}</td>
                    	<td>{element.value}</td>
                      	<td>{element.date}</td>
                      	<td>
							<div className="delete"><img src={deleteIcon} alt="Delete icon" /></div>
						</td>
                    </tr>
                  ))}
                </tbody>
            </table>
        </div>      
    )
}

export default List;

function setItems(res: any) {
	throw new Error('Function not implemented.');
}
